PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_user_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "auth_user" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "username" varchar(150) NOT NULL UNIQUE, "last_name" varchar(150) NOT NULL, "email" varchar(254) NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "first_name" varchar(150) NOT NULL);
CREATE TABLE IF NOT EXISTS "data_project" ("project_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "start_date" datetime NOT NULL, "end_date" datetime NOT NULL, "status" varchar(100) NOT NULL, "description" text NOT NULL, "updated_at" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "data_user" ("user_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "username" varchar(255) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "password" varchar(255) NOT NULL, "phone_number" varchar(20) NOT NULL, "created_at" datetime NOT NULL, "updated_at" datetime NOT NULL, "bio" text NULL);
CREATE TABLE IF NOT EXISTS "data_feedback" ("feedback_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "text" text NOT NULL, "user_id" integer NOT NULL REFERENCES "data_user" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_feedback_project" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "feedback_id" integer NOT NULL REFERENCES "data_feedback" ("feedback_id") DEFERRABLE INITIALLY DEFERRED, "project_id" integer NOT NULL REFERENCES "data_project" ("project_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_task" ("task_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "task_name" varchar(255) NOT NULL, "task_description" text NOT NULL, "feedbacks_id" integer NULL REFERENCES "data_feedback" ("feedback_id") DEFERRABLE INITIALLY DEFERRED, "project_id" integer NOT NULL REFERENCES "data_project" ("project_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_task_users" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "task_id" integer NOT NULL REFERENCES "data_task" ("task_id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "data_user" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_role" ("role_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "role_name" varchar(255) NOT NULL, "users_id" integer NOT NULL REFERENCES "data_user" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_project_users" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "project_id" integer NOT NULL REFERENCES "data_project" ("project_id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "data_user" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_notification" ("notification_id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "message" text NOT NULL, "is_read" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "data_notification_feedbacks" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "notification_id" integer NOT NULL REFERENCES "data_notification" ("notification_id") DEFERRABLE INITIALLY DEFERRED, "feedback_id" integer NOT NULL REFERENCES "data_feedback" ("feedback_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_notification_projects" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "notification_id" integer NOT NULL REFERENCES "data_notification" ("notification_id") DEFERRABLE INITIALLY DEFERRED, "project_id" integer NOT NULL REFERENCES "data_project" ("project_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_notification_tasks" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "notification_id" integer NOT NULL REFERENCES "data_notification" ("notification_id") DEFERRABLE INITIALLY DEFERRED, "task_id" integer NOT NULL REFERENCES "data_task" ("task_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "data_notification_users" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "notification_id" integer NOT NULL REFERENCES "data_notification" ("notification_id") DEFERRABLE INITIALLY DEFERRED, "user_id" integer NOT NULL REFERENCES "data_user" ("user_id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
